import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export function Home() {
  return (
    <View style={styles.container}>
      <Text style={styles.heading}>Willkommen bei TSM2.0</Text>
      {/* Hier könnten weitere Elemente wie Benachrichtigungen, Links zu anderen Funktionen etc. hinzugefügt werden */}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  heading: {
    fontSize: 24,
  },
});
